import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { loadDogs, changePage } from '../../redux/actions/index';
import { Link } from 'react-router-dom';
import DogCard from '../dogCard/DogCard';

const DogsList = () => {
  const dispatch = useDispatch();
  const { currentPage, dogsPerPage, filteredDogs } = useSelector(state => state.dogs);

  useEffect(() => {
    dispatch(loadDogs());
  }, [dispatch]);

  const indexOfLastDog = currentPage * dogsPerPage;
  const indexOfFirstDog = indexOfLastDog - dogsPerPage;
  const currentDogs = filteredDogs.slice(indexOfFirstDog, indexOfLastDog);

  return (
    <div className="dogs-list">
      <DogCard></DogCard>
      {currentDogs.map((dog) => (
        <Link key={dog.id} to={`/dogs/${dog.id}`}>
          <div className="dog-card">
            <img src={dog.image.url} alt={dog.name} />
            <h2>{dog.name}</h2>
              <ul>
              <li>{dog.temperaments[0]}</li>
              <li>{dog.temperaments[1]}</li>
              <li>{dog.temperaments[2]}</li>
              <li>{dog.temperaments[3]}</li>
              <li>{dog.temperaments[4]}</li>
              </ul>
              <h4>{dog.weight}</h4>
          </div>
        </Link>
      ))}
    </div>
  );
};

export default DogsList;
